import React from "react";
import LoginLeftSideBar from "./loginLeftSideBar";
import loginImg from "../images/LoginImg.png";
const login = () => {
  return (
    <div style={{ display: "flex" }}>
      <div style={{ flex: 1 }}>
        <LoginLeftSideBar />
      </div>
      <img src={loginImg} style={{ flex: 3.5 }}></img>
    </div>
  );
};

export default login;
